import React from 'react';

function header(props) {
    return (
        <div class="header">
            <div class="header-logo">
                <i className="fa-brands fa-facebook"></i>
                <img src={props.logo} alt="logo" className="header-logo-image" />
            </div>
        </div>
    );
}

export default header;
